import React, { Component } from "react";
import ListItem from "./ListItem";

class TodoList extends Component{
    render() {
        const todoList = [
            'React practice',
            'game time'
        ];

        return(
            <div>
                {
                    todoList.map(item => <ListItem item={item}/>)
                }
            </div>
        )

    }
}

export default TodoList;
